import React from 'react';

function NavIcon ({titleIcon, iconStyle, NavTabText, NavTabStyle}) {
    
    
    return (
        <div>
            <li style={iconStyle}>
                <p style={NavTabStyle}>
                    <a style={NavTabText} className="NavTab__button-text" href="#top" >{titleIcon}</a>
                </p>
            </li>
        </div>
    );
}

export default NavIcon;
